I strongly believe that chaining should be implemented in all your functions, eg:

```javascript
    $('.tags').importTags(tagstr).show();
`

This will fail, as no return value is provided for method `import tags`. The fix is to provide a `return this` in public methods, eg: 

```javascript
    $.fn.importTags = function(str) {
         var id = $(this).attr('id');
         $('#'+id+'_tagsinput .tag').remove();
         $.fn.tagsInput.importTags(this,str);
         return this; // enabled chaining.
     }
`

Not sure why this is not implemented.

